import { hexToBytes } from '@ethereumjs/util'
import jayson from 'jayson/promise/index.js'
import { decodeHistoryNetworkContentKey } from 'portalnetwork'

import type { HttpClient } from 'jayson/promise/index.js'
// - content_key: "0x0117aa411843cb100e57126e911f51f295f5ddb7e9a3bd25e708990534a828c4b7"
//   content_value: ""
// - content_key: "0x0217aa411843cb100e57126e911f51f295f5ddb7e9a3bd25e708990534a828c4b7"
//   content_value: ""
const contentKey = '0x0117aa411843cb100e57126e911f51f295f5ddb7e9a3bd25e708990534a828c4b7'
const content =
  ''

const { Client } = jayson

const main = async () => {
  console.log(decodeHistoryNetworkContentKey(hexToBytes('0x03eb3e400100000000')))
  const ultralights: HttpClient[] = []
  const enrs: string[] = []
  const nodeIds: string[] = []

  for (let i = 0; i < 3; i++) {
    const ultralight = Client.http({ host: '0.0.0.0', port: 8545 + i })
    const ultralightENR = await ultralight.request('discv5_nodeInfo', [])
    ultralights.push(ultralight)
    enrs.push(ultralightENR.result.enr)
    nodeIds.push(ultralightENR.result.nodeId)
  }

  const res = await ultralights[0].request('portal_historyStore', [contentKey, content])
  console.log(res.result)
  await new Promise((res) => {
    setTimeout(res, 1000)
  })
  const stored = await ultralights[0].request('portal_historyLocalContent', [contentKey])
  console.log(stored.error === undefined ? 'success' : 'failure')

  const findContentRes = await ultralights[1].request('portal_historyFindContent', [
    enrs[0],
    contentKey,
  ])
  console.log(findContentRes)
}

void main()
